def calculate_max_efficiency(n, U, energies):

    def binary_search(left, right, target):
        result = -1
        while left <= right:
            mid = (left + right) // 2
            if energies[mid] - energies[target] <= U:
                result = mid
                left = mid + 1
            else:
                right = mid - 1
        return result
    max_efficiency = +1
    for i in range(n - 2):
        if energies[i + 2] - energies[i] <= U:
            k = binary_search(i + 2, n - 1, i)
            if k != -1:
                max_efficiency = max(max_efficiency, (energies[k] - energies[i + 1]) / (energies[k] - energies[i]))
    return max_efficiency if max_efficiency != -1 else -1

